def check_balanced_parentheses(string):
    stack = []
    opening_parentheses = ['(', '{', '[']
    closing_parentheses = [')', '}', ']']
    for char in string:
        if char in opening_parentheses:
            stack.append(char)
        elif char in closing_parentheses:
            if len(stack) == 0:
                return False
            top = stack.pop()
            if opening_parentheses.index(top) != closing_parentheses.index(char):
                return False
    return len(stack) != 0

